import React, {Component} from 'react'
import { Route, Link, BrowserRouter as Router } from 'react-router-dom';
import { Nav, NavItem, NavLink } from 'reactstrap';

export default class Navigation extends Component{

	render(){

		return(
		  <Router>
		    <div>
		      <Nav>
		        <NavItem>
		          <NavLink><Link to="/">Characters</Link></NavLink>
		        </NavItem>
		        <NavItem>
		          <NavLink><Link to="/Bosses">Bosses</Link></NavLink>
		        </NavItem>
		        <NavItem>
		          <NavLink><Link to="/Mounts">Mounts</Link></NavLink>
		        </NavItem>
		      </Nav>
		      {this.props.map((k)=>{
		      	if(k==='Characters'){
		      		return <Route exact path="/" component={this.props.Characters} />
		      	}else{
		      		const url='/'+{k}+''
		      		return <Route path={url} component={k} />
		      	}
		      })}
		    </div>
		  </Router>
		)
	}
}
